export const FilteredList = (props) => { 
   let persons = props.persons
   let filteredNames = props.filterNames
   let micos = props.previewList
   console.log("MICOS LCOOS", micos)

   let results = persons.filter((e)=> { return e.name === filteredNames})
   let respuesta = persons.filter((e)=> e.name.startsWith(props.previewList)? e.name : null)
   console.log("RESPUESTA", respuesta)
   return <form onSubmit={props.onSubmitFilter}>
           <input
               placeholder="Search..."
               value={props.filterNames}
               onChange={props.onChangeFilter}
           />
           <p>Results from your contact list:</p>
           <ul>
               {respuesta.map((e,i) => {
                   if(respuesta){
                       return <li key={i}>{props.previewList} {e.number}</li>
                   }               
                   }) 
               }            
               {/* {results.map((e,i) => {
                   if(results){
                       return <li key={i}>{filteredNames} {e.number}</li>
                   }               
                   }) 
               }             */}
           </ul>
       </form>    
 }
